import React from 'react';
import "./deviceSelector.scss";

const DeviceSelector = props => {
    return(
        <button className="device-selector" onClick={ () => {props.toggle(props.deviceName)}}>
            <img src={props.device} alt={props.device}></img>
            <h3>{props.deviceName}</h3>
            <span className='device-selector-btn'>Get Help</span>
        </button>
    )
}

export default DeviceSelector;
